import "./App.css";
import * as React from "react";
import { SearchBar } from "react-native-paper";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Song Recommendation Tool</h1>
      </header>
      <div className="Song Search">
        <p>Song Search</p>
        <SearchBar placeholder="Find Song..." />
      </div>
    </div>
  );
}

export default App;
